specVersion: 0.0.1
description: Setheum SubQL
repository: https://github.com/setheum-js/setheum-subql
schema: ./schema.graphql
network:
  endpoint: wss://polkadot.api.onfinality.io/public-ws
  dictionary: https://api.subquery.network/sq/subquery/dictionary-polkadot
  typesBundle:
    spec:
      acala:
        rpc:
          &a62
          oracle:
            getValue:
              description: Retrieves the oracle value for a given key.
              params:
                - name: providerId
                  type: RpcDataProviderId
                - name: key
                  type: OracleKey
                - name: at
                  type: BlockHash
                  isHistoric: true
                  isOptional: true
              type: Option<TimestampedValue>
              isSubscription: false
              jsonrpc: oracle_getValue
              method: getValue
              section: oracle
            getAllValues:
              description: Retrieves all oracle values.
              params:
                - name: providerId
                  type: RpcDataProviderId
                - name: at
                  type: BlockHash
                  isHistoric: true
                  isOptional: true
              type: Vec<(OracleKey, Option<TimestampedValue>)>
              isSubscription: false
              jsonrpc: oracle_getAllValues
              method: getAllValues
              section: oracle
          dex:
            getSupplyAmount:
              description: Get supply amount
              params:
                - name: supplyCurrencyId
                  type: CurrencyId
                - name: targetCurrencyId
                  type: CurrencyId
                - name: targetCurrencyAmount
                  type: BalanceRequest
              type: BalanceWrapper
              isSubscription: false
              jsonrpc: dex_getSupplyAmount
              method: getSupplyAmount
              section: dex
            getTargetAmount:
              description: Get target amount
              params:
                - name: supplyCurrencyId
                  type: CurrencyId
                - name: targetCurrencyId
                  type: CurrencyId
                - name: supplyCurrencyAmount
                  type: BalanceRequest
              type: BalanceWrapper
              isSubscription: false
              jsonrpc: dex_getTargetAmount
              method: getTargetAmount
              section: dex
          evm:
            call:
              description: eth call
              params:
                - name: data
                  type: CallRequest
                - name: at
                  type: BlockHash
                  isHistoric: true
                  isOptional: true
              type: Raw
              isSubscription: false
              jsonrpc: evm_call
              method: call
              section: evm
            estimateResources:
              description: eth estimateResources
              params:
                - name: from
                  type: H160
                - name: unsignedExtrinsic
                  type: Bytes
                - name: at
                  type: BlockHash
                  isHistoric: true
                  isOptional: true
              type: EstimateResourcesResponse
              isSubscription: false
              jsonrpc: evm_estimateResources
              method: estimateResources
              section: evm
        instances:
          council:
            - generalCouncil
